import { NgModule } from '@angular/core';
import { HttpClientModule } from '@angular/common/http';
import { AppComponent } from './app.component';
import { SearchFlightComponent } from './search-flight/search-flight.component'; // Adjust the import path if necessary
import { FlightService } from './flight.service'; // Adjust the import path if necessary

@NgModule({
  declarations: [
    AppComponent,
    SearchFlightComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule
  ],
  providers: [FlightService],
  bootstrap: [AppComponent]
})
